(3172, 4600, 'ต่าย', '317/17 หมู่ที่ 4 หมู่บ้านสินธานี 3 ต.ท่าสาย องเมือง จ.เชียงราย 57000', '0867296291', 'นางนันทวรรณ ศิริเสถียร\r\nชื่อเล่น ต่าย\r\nเกิดวันจันทร์ ที่ 27 กุมภาพันธ์ 2527 ปีหนู\r\nเกิดเวลาประมาณ 6-7โมงเช้า\r\nอันที่จริง ราคาเบอร์นี้สูงกว่าที่ตั้งไว้ แต่คุณสมบัติตรงใจที่สุด หากมีเบอร์อื่น ที่ราคาถูกกว่านี้สักนิดและใก้เคียงก็ดีค่ะ  \r\nอยากให้เบอร์สนับสนุนครอบครัว ต้องการมีธุรกิจตัวเอง ไม่ทำงานประจำ สามารถทำงานที่บริหารเวลาเองได้ แต่มั่นคง และมีกินมีใช้ เก็บเงินเก่ง\r\n\r\nชื่อ\r\n นันทวรรณ ศิริเสถียร เกิด27/02/2527เวลาประมาณ6-8โมงเช้า\r\n\r\nทะเบียนรถหลัก4344\r\n อีกคันสำรอง2869\r\n\r\nบ้านชื่อตัวเองเลขที่317/17\r\n บ้านชื่อแม่ ไม่ได้อยู่เอง เลขที่319\r\n\r\nสามี ชื่อ รพีพงษ์ ศิริเสถียร เกิด14/01/2521เวลา18.15\r\n\r\nลูกคนโต ผู้ชาย ชื่อธันวา ศิริเสถียร เกิด17/12/2555 เวลา 21.45\r\n\r\nลูกคนเล็ก ผู้ชาย ชื่อลาภิน ศิริเสถียร เกิด 31/01/2558 เวลาประมาณ 13.00-15.00 จำไม่ค่อยชัดเจนค่ะ\r\n\r\nอยากให้เบอร์ส่งเสริมครอบครัว เนื่องจากมักทะเลาะกับสามีบ่อยๆ พูดกันไม่เข้าใจ\r\n และส่งเสริมด้านกาารเงินค่ะ เพราะเบอร์เดิม ก่อหนี้ตัวแดงหาเท่าไรไม่พอตามทำนายเลย\r\n\r\nขอบคุณมากค่ะ รู้สึกเป็นครั้งแรกที่เปิดใจกับเรื่องพวกนี้ ต้องรบกวนด้วยนะคะ\r\n', '2015-10-19 15:32:07'),
